import { Fragment } from "react";
import  './Header.css';
import meals from '../../Assets/meals.jpg';

const Header=(props)=>{
    return <Fragment>
        <header className="header">
            <h1>React Meals</h1>
            <button>Cart</button>
        </header>
        <div className={classes["main-image"]}>
            <img src={meals} alt="delicious food"/>
        </div>
    </Fragment>
}

export default Header;
